import React from "react";

const DetailList = (props) => {
  return (
    <div className="container">
      {props.list.map((list) => {
        return (
          <div className="row">
            <div className="col-12 col-lg-2">
              <img src={list} />
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default DetailList;
